import fetch from "isomorphic-fetch";

const Img = ({ data }) => {
  return (
    <div>
      <h2> Images </h2>
      <img> </img>
    </div>
  );
};

Img.getInitialProps = async () => {
  try {
    const images = await fetch(
      "http://www.recipepuppy.com/api/?i=onions,garlic&q=omelet"
    );
    const res = await images.json();
    console.log(res);
    return { data: res };
  } catch (err) {
    console.log("Something went wrong!", err);
  }
};

export default Img;
